import React from "react";
import { FirstName, LastName } from "./Comp";
const CompC = () => {
  return (
    <>
      <FirstName.Consumer>
        <LastName.Consumer>
          {(fname, lname) => {
            return (
              <h1>
                Component C is Here My Name is {fname} {lname}
              </h1>
            );
          }}
        </LastName.Consumer>
      </FirstName.Consumer>
    </>
  );
};

export default CompC;
